g the\ncontact information provided below (a “Notification”).<span style=\"mso-spacerun:yes\">&nbsp; </span>A copy of your Notification will be sent to\nthe person who posted or stored the material addressed in the\nNotification.<span style=\"mso-spacerun:yes\">&nbsp; </span>Please be advised that\npursuant to federal law you may be held liable for damages if you make material\nmisrepresentations in a Notification. Thus, if you are not sure that material\nlocated on or linked to by the Site infringes your copyright, you should\nconsider first contacting a lawyer. <br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:115%\"><span style=\"font-size:11.0pt;line-height:115%;font-family:\" arial\",sans-serif;=\"\" mso-fareast-font-family:arial\"=\"\">All Notifications should include the following information: (1) A\nphysical or electronic signature of a person authorized to act on behalf of the\nowner of an exclusive right that is allegedly infringed; (2) identification of\nthe copyrighted work claimed to have been infringed, or, if multiple\ncopyrighted works on the Site are covered by the Notification, a representative\nlist of such works on the Site; (3) identification of the material that is\nclaimed to be infringing or to be the subject of infringing activity and that is\nto be removed or access to which is to be disabled, and information reasonably\nsufficient to permit us to locate the material; (4) information reasonably\nsufficient to permit us to contact the complaining party, such as an address,\ntelephone number, and, if available, an email address at which the complaining\nparty may be contacted; (5) a statement that the complaining party has a good\nfaith belief that use of the material in the manner complained of is not\nauthorized by the copyright owner, its agent, or the law; and (6)<span style=\"mso-spacerun:yes\">&nbsp; </span>a statement that the information in the\nnotification is accurate, and under penalty of perjury, that the complaining\nparty is authorized to act on behalf of the owner of an exclusive right that is\nallegedly infringed upon. <br></span></p><span style=\"font-size:11.0pt;line-height:115%;font-family:\" arial\",sans-serif;=\"\" mso-fareast-font-family:arial\"=\"\">&nbsp;</span>\n\n<h1><a name=\"_97k6yqrr20ny\"></a>TERM AND TERMINATION</h1>\n\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:115%\"><span style=\"font-size:11.0pt;line-height:115%;font-family:\" arial\",sans-serif;=\"\" mso-fareast-font-family:arial\"=\"\">These Terms of Use shall remain in full force\nand effect while you use the Site. WITHOUT LIMITING ANY OTHER PROVISION OF\nTHESE TERMS OF USE, WE RESERVE THE RIGHT TO, IN OUR SOLE DISCRETION AND WITHOUT\nNOTICE OR LIABILITY, DENY ACCESS TO AND USE OF THE SITE (INCLUDING BLOCKING\nCERTAIN IP ADDRESSES), TO ANY PERSON FOR ANY REASON OR FOR NO REASON, INCLUDING\nWITHOUT LIMITATION FOR BREACH OF ANY REPRESENTATION, WARRANTY, OR COVENANT\nCONTAINED IN THESE TERMS OF USE OR OF ANY APPLICABLE LAW OR REGULATION. WE MAY\nTERMINATE YOUR USE OR PARTICIPATION IN THE SITE OR DELETE [YOUR ACCOUNT AND]\nANY CONTENT OR INFORMATION THAT YOU POSTED AT ANY TIME, WITHOUT WARNING, IN OUR\nSOLE DISCRETION. &nbsp; <br></span></p>\n\n<p class=\"MsoNormal\" style=\"text-align:justify;line-height:115%\"><span style=\"font-size:11.0pt;line-height:115%;font-family:\" arial\",sans-serif;=\"\" mso-fareast-font-family:arial\"=\"\">If we terminate or suspend your account for any\nreason, you are prohibited from registering and creating a new account under\nyour name, a fake or borrowed name, or the name of any third party, even if you\nmay be acting on behalf of the third party. In addition to terminating or\nsuspending your account, we reserve the right to take appropriate legal action,\nincluding without limitation pursuing civil, criminal, and injunctive redress. <br></span></p>\n\n<h1><a name=\"_iu8vbv7ttwtj\"></a>MODIFICATIONS AND INTERRUPTIONS </h1>\n\n<p class=